import React, { useEffect } from 'react';

const CommunityIntakeForm: React.FC = () => {
  useEffect(() => {
    const loadScripts = (src: string, async: boolean = true, defer: boolean = false) => {
      const script = document.createElement('script');
      script.src = src;
      script.async = async;
      script.defer = defer;
      document.body.appendChild(script);
    };

    // Load necessary JotForm scripts
    loadScripts('https://cdn02.jotfor.ms/static/prototype.forms.js?v=3.3.60465');
    loadScripts('https://cdn03.jotfor.ms/static/jotform.forms.js?v=3.3.60465');
    loadScripts('https://cdn01.jotfor.ms/js/vendor/maskedinput_5.0.9.min.js?v=3.3.60465');
    loadScripts('https://cdn02.jotfor.ms/js/punycode-1.4.1.min.js?v=3.3.60465', false, true);
    loadScripts('https://cdn01.jotfor.ms/s/umd/245dadadc89/for-pdfimporter-patch.js?v=3.3.60465');
    loadScripts('https://cdn01.jotfor.ms/s/umd/245dadadc89/for-form-branding-footer.js?v=3.3.60465', false, true);
    loadScripts('https://cdn03.jotfor.ms/js/vendor/smoothscroll.min.js?v=3.3.60465');
    loadScripts('https://cdn01.jotfor.ms/js/errorNavigation.js?v=3.3.60465');

    // Inline script to set JotForm properties
    const scriptContent = document.createElement('script');
    scriptContent.innerHTML = `
      window.enableEventObserver = true;
      JotForm.newDefaultTheme = true;
      JotForm.extendsNewTheme = false;
      JotForm.CDN_VENDOR_PATH = "https://cdn02.jotfor.ms/s/vendor/static";
      JotForm.singleProduct = false;
      JotForm.newPaymentUIForNewCreatedForms = true;
      JotForm.isFullSource = true;
    `;
    document.body.appendChild(scriptContent);
  }, []);

  return (
    <div>
      <iframe
        title="Community Intake Form"
        src="https://form.jotform.com/250257640384053"
        width="100%"
        height="1200px"
        style={{ border: 'none' }}
      />
    </div>
  );
};

export default CommunityIntakeForm;
